paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 12:
    case 16:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 3:
    case 11:
        {
            value = (value < 0 ? 0 : (value > 14 ? 14 : value));
            let normalizedValue = (value - 0) / (14 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 15);
            }

            return normalizedValue;
        }
    case 0:
    case 1:
    case 2:
    case 5:
    case 10:
    case 14:
        {
            value = (value < 0 ? 0 : (value > 127 ? 127 : value));
            let normalizedValue = (value - 0) / (127 - 0);
            return normalizedValue;
        }
    case 4:
    case 7:
    case 8:
    case 9:
    case 13:
        {
            value = (value < 1 ? 1 : (value > 3 ? 3 : value));
            let normalizedValue = (value - 1) / (3 - 1);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 3);
            }

            return normalizedValue;
        }
    case 15:
        {
            value = (value < 1 ? 1 : (value > 4 ? 4 : value));
            let normalizedValue = (value - 1) / (4 - 1);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 4);
            }

            return normalizedValue;
        }
    case 6:
        {
            value = (value < 100 ? 100 : (value > 5000 ? 5000 : value));
            let normalizedValue = (value - 100) / (5000 - 100);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 500);
            }

            return normalizedValue;
        }
    default:
        return value;
    }
}

